  [],\n\t\"revision_timestamp\": \"2016-10-04T01:17:58.842253\",\n\t\"name\": \"chlorophyll-a-concentration-collected-from-oscar-elton-sette-in-hawaii-eez-and-papahanaumokuake\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Water samples were collected from the ocean
  surface using a bucket and from below the surface using bottles attached to the
  CTD during a Pacific Islands Fisheries Science Center's Cetacean Research Program's
  shipboard cetacean survey (Cruise ID SE 13-03). A minimum of three surface water
  samples were taken each day, primarily at 0900, 1200, and 1500 hours local ship
  time. Surface water samples were also collected opportunistically during some cetacean
  sightings. CTD samples were collected once each morning.nnThe 250ml water samples
  were filtered onto GF/F filters, placed in 10ml of 90% acetone, refrigerated or
  frozen for 24 hours, and then analyzed for chlorophyll a concentration using the
  Turner Designs model 10AU field flourometer. Measurements were recorded in an Excel
  spreadsheet.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
